import React from "react";

function PlaceWithBtn(props) {
  return (
    <div className="PlaceWithBtn">
      <div className="modifyBtn">
        <button id="recommend">재추천</button>
        <button id="delete">삭제</button>
      </div>
      <div id="simage">
      <div id="sname">{props.item.starnum}</div>
      </div>
      <div className="placeinfo">
        <div id="sname">{props.item.title}</div>
        <div id="saddress">{props.item.adderss}</div>
      </div>
    </div>
  );
}

export default PlaceWithBtn;
